class Solution {
public:
    int minExtraChar(string s, vector<string>& dictionary) {
        set<string> st(dictionary.begin(), dictionary.end());
        int n = s.size();
        vector<int> dp(n + 1, n);
        dp[n] = 0;

        for (int i = n - 1; i >= 0; --i) {
            dp[i] = i + 1;
            for (int j = i; j < n; ++j) {
                if (st.find(s.substr(i, j - i + 1)) != st.end()) {
                    dp[i] = min(dp[i], dp[j + 1]);
                }
            }
            if (dp[i] == n) dp[i] = s.size() - i;
            else dp[i] += dp[dp[i]];
        }
        return dp[0];
    }
};
